【スタッフコメント★】<br>
デニム素材のサロペット!!<br>
オーバーオールとは違う可愛さ♪<br>
年中着れるからコーデもいろいろ★<br><br>
<br>
【Sサイズ】 <br>
ウエスト：78cm/股上：30cm/股下:61cm/ワタリ：26cm/裾幅14cm<br>
【Mサイズ】 <br>
ウエスト：84cm/股上：30cm/股下:64cm/ワタリ：28cm/裾幅16cm<br>
【Lサイズ】 <br>
ウエスト：90cm/股上：32cm/股下:65cm/ワタリ：29cm/裾幅16cm<br>

